import React from 'react';
import './Task_css.css';



function Moviedetails() {
  return (
  <>
   <div className="card mb-3" >
	  <div className="row g-0">
		<div className="col-md-4">
		  <img src="https://cartoonimages.club/wp-content/uploads/2021/02/Ainbo-Spirit-Of-Amazon-cartoonimages-club-Zumi-448x560.jpg" className="img-fluid rounded-start" alt="not loading" height="200" width="200"/>
		</div>
		<div className="col-md-8">
		  <div className="card-body">
			<h5 className="card-title">Movie title</h5>
			<p className="card-text">This is a wider card</p>
			<p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p>
		  </div>
		</div>
	  </div>
	</div>

  </>
  );
}

export default Moviedetails;
